import React from 'react';
import {Routes,Route} from 'react-router-dom';

import Chat from './components/Chat';
export default function App()
{
    return (
        <div>
        <Chat/>
        <Routes>
            <Route path = '/client' />
            <Route path = '/chat' component={Chat} />
        </Routes>
        </div>
    );
}
